import {Container} from 'react-bootstrap'
import './App.css';

function App() {
    return ( 
    <div className = "App" >
      <Container>
        <div style="font-size: var(--fs-display); color: var(--accent-success);">This is a display</div>

        <div style="width: 50px; height: 50px; background-color: white;">holoholo</div>
      </Container>
    </div>
    );
}

export default App;
